import React from 'react';

import Paper from '@matrial-ui/core/Paper'
import Table from '@material-ui/core/Table';
import TableHead from '@material-ui/core/TableHead'
import TableBody from '@material-ui/core/TableBody'
import TableRow from '@material-ui/core/TableRow';
import TableCell from '@material-ui/core/TableCell';
import {withStyles} from '@material-ui/core/styles'

import './App.css';

const albums = [
    {
        id : 1,
        name : 'Future Nostalgia',
        artist : 'Dua Lipa',
        image : 'http://13.209.35.76:3000/images/1.jpg'
    },
    {
        id : 2,
        name : 'The New Abnormal',
        artist : 'The Strokes',
        image : 'http://13.209.35.76:3000/images/2.jpg'
    },
    {
        id : 3,
        name : 'Punisher',
        artist : 'Phoebe Bridgers',
        image : 'http://13.209.35.76:3000/images/3.jpg'
    }
]

const styles = theme => ({
    root: {
        width: "100%",
        marginTop: theme.spacing.unit * 3,
        overflowX: "auto"
    },
    table: {
        minWidth: 1080
    }
});

class Album extends React.Component {
    render() {
        const {id, name, artist, image} = this.props;
        return (
            <TableRow>
                <TableCell>{id}</TableCell>
                <TableCell><img src={image} alt={name} /></TableCell>
                <TableCell>{name}</TableCell>
                <TableCell>{artist}</TableCell>
            </TableRow>
        );
    }
}

class App extends React.Component {
    render() {
        return (
            <div>
                <center>
                    <h1>
                        대중 음악의 이해
                    </h1>
                    <h2>
                        정기 음평회 UPLOAD WEBPAGE
                    </h2>
                </center>
                <Paper className={classes.root}>
                    <Table className = {classes.table}>
                        <TableHead>
                            <TableRow>
                                <TableCell>음평회 순서</TableCell>
                                <TableCell>Album Cover</TableCell>
                                <TableCell>Album Name</TableCell>
                                <TableCell>Artist</TableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {albums.map( album => {
                                return <Album 
                                    key = {album.id}
                                    id = {album.id}
                                    name = {album.name}
                                    artist = {album.artist}
                                    image = {album.image}
                                />
                            })}
                        </TableBody>
                    </Table>
                </Paper>
            </div>
        );
    }
}

export default withStyles(styles)(App);
